package server_test

import (
	"io/ioutil"
	"log"
	"testing"

	"github.com/drewolson/testflight"
	"github.com/stretchr/testify/assert"
	"smiloface/src/server"
)

func Test_GifGenerator(t *testing.T) {

	testflight.WithServer(server.InitRouting(), func(r *testflight.Requester) {

		response := r.Post("/face", testflight.FORM_ENCODED, string(data))

		log.Println(len(response.Body))

		ioutil.WriteFile("output.jpeg", response.RawBody, 0644)

		assert.Equal(t, 200, response.StatusCode)
		assert.True(t, len(response.Body) > 0)

	})
}

const data = `





































































































































































`
